paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 0:
    case 3:
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 6:
        {
            value = (value < 0 ? 0 : (value > 200 ? 200 : value));
            let normalizedValue = (value - 0) / (200 - 0);
            return normalizedValue;
        }
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1000 ? 1000 : value));
            let normalizedValue = (value - 0) / (1000 - 0);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < 4 ? 4 : (value > 441000 ? 441000 : value));
            let normalizedValue = (value - 4) / (441000 - 4);
            return normalizedValue;
        }
    case 5:
        {
            value = (value < 100 ? 100 : (value > 10000 ? 10000 : value));
            let normalizedValue = (value - 100) / (10000 - 100);
            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 0:
    case 3:
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (1 - 0);
            }
        }
    case 6:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (200 - 0);
            }
        }
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (1000 - 0);
            }
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 4 + value * (441000 - 4);
            }
        }
    case 5:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 100 + value * (10000 - 100);
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 1:
        {
            v = (v > 441000 ? 441000 : (v < 4 ? 4 : v));
            return v;
        }
    case 2:
        {
            v = (v > 1000 ? 1000 : (v < 0 ? 0 : v));
            return v;
        }
    case 3:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 4:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 5:
        {
            v = (v > 10000 ? 10000 : (v < 100 ? 100 : v));
            return v;
        }
    case 6:
        {
            v = (v > 200 ? 200 : (v < 0 ? 0 : v));
            return v;
        }
    default:
        return value;
    }
}
